/**
 *
 * Footer.js
 * @author Peter Laxalt
 * @description The website footer.
 *
 */

// Core
import React from "react";

// Styles
import { FooterClassName, FooterStyle } from "./styles.scss";

// Begin Component
//////////////////////////////////////////////////////////////////////

export const Footer = () => {
  return (
    <FooterStyle className={`${FooterClassName}`}>
      <div className={`${FooterClassName}__inner`}>
        <div className={`${FooterClassName}__bottom`}>
          <div className={`${FooterClassName}__bottom__col ${FooterClassName}__bottom__col--one`}>
            <span>Back to top</span>
          </div>
          <div className={`${FooterClassName}__bottom__col ${FooterClassName}__bottom__col--two`}>
            <span>STUDIO LAXALT</span>
            <span>Â©2020 ALL RIGHTS RESERVED</span>
          </div>
          <div className={`${FooterClassName}__bottom__col ${FooterClassName}__bottom__col--three`}>
            <span>Currently / Brooklyn, NYC</span>
            <span>Originally / Reno, Nevada</span>
          </div>
        </div>
      </div>
    </FooterStyle>
  );
};

// End Component
